import React from "react";
import { Container } from "react-bootstrap";
import Beitrag from "../Beitrag";

const BeitragDeck = () => {
  return (
    <Container className="border mt-4 col-md-6 p-4">
     <Beitrag name="Max" text="Hallo Welt"></Beitrag>
     <Beitrag name="Max" text="Hallo Welt"></Beitrag>
     <Beitrag name="Max" text="Hallo Welt"></Beitrag>
     <Beitrag name="Max" text="Hallo Welt"></Beitrag>
    </Container>
  );
};

export default BeitragDeck;
